description:
Einstein and Eddington (2008)  

Verenigd Koninkrijk / Verenigde Staten
Drama
120 minuten

geregisseerd door Philip Martin
met Andy Serkis, David Tennant en John Bowe

Terwijl de Eerste Wereldoorlog losbarst, werkt de obscure Duitse natuurkundige Albert Einstein aan een nieuwe theorie over de zwaartekracht. De Britse astrofysicus Arthur Eddington onderhoudt een intensieve correspondentie met Einstein en het tweetal zal uiteindelijk voor de grootste wetenschappelijke doorbraak van de 20ste eeuw zorgen.



